import React, {Component} from 'react';
import DatePicker from 'react-date-picker';

class PersonalInfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      text: 1,
    }
  }

  render() {
    return (
    <section className="personal">
      <div className="personal-header">
        <div className="personal-header__photo">
          <img src={window.location.origin + `/img/photos/images.png`} />
          <a>Изменить фото профиля</a>
        </div>
        <div className="personal-header__info">
          <label>Имя</label>
          <input type="text" value="Sergey" />
          <label>Фамилия</label>
          <input type="text" value="Alekyan" />
          <label>Должность</label>
          <input type="text" value="full stack developer"/>
          <label>Дата рождения</label>
          <input type="date" value="12-03-1993" />
          <p>Год рождения будет виден только руководству</p>
        </div>
      </div>
    </section>  
   )
  }

}

export default PersonalInfo;
